const Home = () => {
	const router = useRouter();

	const toTest = () => {
		router.push("/test");
	};

	return (
		<>
			<Row justify="center">
				<Col {...centerCol}>
					<Texty strong top={100} bottom={-30} font={20}>
						나랑 어울리는 애완동물은?
					</Texty>
				</Col>
			</Row>

			<Row justify="center">
				<Col {...centerCol}>
					<WidthImg src={require("../assets/images/deoksun.png")} />
				</Col>
			</Row>

			<Row justify="center">
				<Col xs={18} sm={18} md={12} lg={10} xl={8}>
					{/* <Button
						type="primary"
						style={{
							display: "block",
							marginTop: "-90px",
							width: "100%",
							height: "40px",
						}}
						onClick={toTest}
					></Button> */}
					<ActionBtn>
						<Texty>추천 시작!</Texty>
					</ActionBtn>
				</Col>
			</Row>

			<Row style={{ height: "200px" }}></Row>
		</>
	);
};

export default Home;
